import "./Navbar.css"

const Navbar = () => {
    return (
        <div className="navbar">
            <span className="logo">Lama App</span>
            <div className="icons">
                <img src="" className="iconImg" alt="" />
                <div className="counter"></div>
            </div>
        </div>
    )
}

export default Navbar;
